import React, {useState, useEffect} from 'react'


function DataFetching() {
    const [post, setPost] = useState([]);

    useEffect(() => {
        fetch('./records.json')
            .then(res => {
                return res.json();
            })
            .then(res => {
                setPost(res)
            })
    }, []);

  return (
    <div className="post">
        <ul>
            {post && post.map(post => {
            return <div>{post.title}</div>
        })}
        </ul>
    </div>
  )
}
export default DataFetching
